// };

// export default Nav;
export const NavE = styled.div`
  height: 10vh;
  position: sticky;
  padding: 1rem 5rem;
  display: flex;
  align-items: center;
  justify-content: space-between;
  width: 100%;
`;

export const NavIcons = styled.div``;

export const NavLogo = styled.img``;
export const NavItem = styled.li``;
export const NavMenu = styled.ul`
  list-style: none;
  display: flex;
  gap: 1rem;
  justify-content: space-between;
`;
